import styles from "../app.module.css";

function LoginCard() {
  return (
    <div className={styles.loginCard}>
      <h1>Login</h1>
      <div className={styles.cardForm}>
        <input type="text" placeholder="Username" />
        <input type="text" placeholder="Password" />
      </div>
    </div>
  );
}

export default LoginCard;
